import React from "react";
const Login = () => {
  return (
    <section>
      <div>Logo</div>
      <div style={{ backgroundColor: "yellow", height: "1.4rem" }}>
        Login page
      </div>
      <table>
        <thead>
          <td>Login Username</td>
        </thead>
      </table>
    </section>
  );
};
export default Login;
